import React from 'react';

class What extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="whatContainer">
                    <div id="whatImg">
                    <div id="whatContent">
                        <strong><u>What we do:</u></strong><br />
                        This here is what we do. We will most likely have one or two sentences explaining our business.
                    </div>
                    </div>

                    


                    <style jsx>
                        {`

                        #whatContainer {
                            height: 100%;
                            width: 200px;
                            text-align:center;
                            justify-content: center;
                        }

                        #whatImg {
                            height: 200px;
                            width: 200px;
                            background-color: black;
                            margin: auto;
                            border-radius: 50%;
                        }

                        #whatContent {
                            color: white;
                            margin-top: 10px
                            transform: translate(0, 200px);
                        }

                        @media (max-width: 720px) {

                            #whatContainer {
                                height: 100%;
                                width: 100%;
                                margin: auto;
                            }
    
                            #whatImg {
                                height: 100%;
                                width: 100%;
                                background-color: black;
                                margin: auto;
                                border-radius: 0%;
                            }
    
                            #whatContent {
                                color: white;
                                transform: translate(0, 0vh)
                                
                            }

                        }
                        
                        `}
                    </style>
                </div>
            )
        }
    }

export default What;
